actionConfiguration.body:
() => {

		let formDataValue = ExpireCampaignForm.formData;

		formDataValue['campaigns'] = Object.keys(formDataValue['campaigns']).reduce( (globalResult,campaign) => {
					let result = {};
					result['campaign_type'] = formDataValue['campaigns'][campaign];
					globalResult.push(result);
					return globalResult;
		},[])

		storeValue("expire_campaign_body",formDataValue);

		ExpireCampaignApi.run(
			// On success
			()=>{
				showAlert("Campaign  Expired successfully");
				navigateTo("ListingPage");

			},
			// On error
			()=>{
				showAlert("Something went wrong");
			}
		);





		//navigateTo("ListingPage",{ "campaigns": [272,278]});

		// Calling CreateCampaing API


	}

